import React from 'react';
import './App.css';
import Navbar from './components/Navbar'

function App() {
  return (
    <div className="App">
      <Navbar />
    </div>
  );
}


const Home = () => {
  return (
    <div className="Home">
      <Navbar />
    </div>
  )
};

const Download = () => {
  return (
    <div className="Download">
      <Navbar />
    </div>
  )
}

export default App;
export { Home };
